import React from "react";
import "../App.css";

const ContactUs = () => {
  return (
    <>
      <div className="Home1">
        <img
          src={require("./몰입캠프_검정.png").default}
          height="300"
          width="300"
        />
      </div>
      <div className="Home2">
        <h1 className="Home_text">s</h1>
      </div>
    </>
  );
};

export default ContactUs;
